import './index.css';
import DataSummary from './components/DataSummary';
import {useState} from 'react';


function App() {
  const showDataSummary=true;
  const [role,setRole] = useState('dev');
  return (
    <div className="App">

      {showDataSummary ? (
        <div className="App bg-red-300">
          <input type="text" onChange={(e) => {
            console.log(e.target.value);
            setRole(e.target.value);
          }}/>
          <DataSummary name="Day" role="intern"/>
        <DataSummary name="Week" role={role}/>
        <DataSummary name="Month"/>
        </div>
    ) : (
      <p>You cannot see the DataSummaries</p>
    ) }
    </div>
  );
}

export default App;
